INSERT INTO `paragraph__field_caption` VALUES ('image',0,5,226,'en',0,'Do you like roleplaying games? Pick a character!','restricted_html'),('image',0,7,227,'en',0,'This juvenile red-tailed hawk (whose tail isn\'t red yet) came to visit.','restricted_html'),('video',0,16,62,'en',0,'<p>Drupal\'s Media module is not yet quite as robust for videos as it is for images. If you can\'t wait, <a href=\"https://www.drupal.org/project/video_embed_field\">video_embed_field</a> works well now.</p>\r\n','restricted_html'),('image',0,18,260,'en',0,'This is just a sidebar image to illustrate that the sidebar can have more visual structure than media floating within the body area.','restricted_html'),('video',0,21,262,'en',0,'<p>This is the same video that\'s in the page body area.</p>\r\n','basic_html'),('image',0,25,228,'en',0,'Are cats supposed to do that sort of thing? That doesn\'t look comfortable.','restricted_html'),('video',0,29,230,'en',0,'<p>I learned from others. I built upon what they built. And now I\'m passing the torch along to you.</p>\r\n','basic_html'),('image',0,34,255,'en',0,'<p>The&nbsp;Janet L. Swanson Wildlife Health Center offers&nbsp;comprehensive veterinary care for native wild animals.</p>\r\n','restricted_html'),('video',0,36,254,'en',0,'<p>Murray Woodman, the speaker, has been a long time fan of Paragraphs and now of Bricks. He has worked closely on the Modifiers project and wants to share the knowledge when it comes to BPM.</p>\r\n','basic_html'),('image',0,39,253,'en',0,'<p>Cats wrestle as a normal part of play. Learn how to differentiate play fighting from real fighting.</p>\r\n','restricted_html'),('aside',0,43,213,'en',0,'<p><em>This is an aside just to show it off.</em></p>\r\n','restricted_html'),('image',0,45,263,'en',0,'<p>A black-eyed Susan just because it\'s a pretty flower.</p>\r\n','restricted_html');
